import axios from "./axiosaxios";

const getAll = () => {
    return axios.get("/products");
};

const get = id => {
    return axios.get(`/products/${id}`);
};

const create = data => {
    return axios.post("/products", data);
};

const update = (id, data) => {
    return axios.put(`/products/${id}`, data);
};

const remove = id => {
    console.log(id);
    return axios.delete(`/products/${id}`);
};


export default {
    getAll,
    get,
    create,
    update,
    remove,
};
